import { faJsSquare, faPhp } from '@fortawesome/free-brands-svg-icons';
import { faDatabase } from '@fortawesome/free-solid-svg-icons';
import googleLaptop from './images/laptop-image.png'
import React from 'react';
import InfoCard from './infoCard';
import {
  ProjectContainer,
  ProjectText,
  ProjectsIntro,
  ProjectTitle,
  ProjectSubtitle,
  ProjectDescription,
  ToolsContainer,
  ProjectImage
} from './styles';


const Projects = () => {
  return (
    <div>
      <ProjectsIntro>On my free time... </ProjectsIntro>
      <ProjectContainer>
        <ProjectText>
          <ProjectTitle>google clone search engine</ProjectTitle>
          <ProjectSubtitle>PERSONAL SIDE PROJECT: WEB APP DESIGN</ProjectSubtitle>
          <ProjectDescription>Designed and built my own search engine service like Google</ProjectDescription>
          <ToolsContainer>
            <InfoCard color="#c9b7a7" icon={faJsSquare} name="Javascript" />
            <InfoCard color="#c9b7a7" icon={faDatabase} name="MySQL" />
            <InfoCard color="#c9b7a7" icon={faPhp} name="PHP" />
          </ToolsContainer>
        </ProjectText>
        <ProjectImage><img src={googleLaptop}></img></ProjectImage>
      </ProjectContainer>
    </div>
  )
}
export default Projects
